const Icon = (props: IconProps): ReactElement => {
  const { name, style, size, shapeId, variant, outline, path } = props;
  const theme = useSelector((state: RootState) => state.preferences.theme);
  const pathData = useSelector((state: RootState) => name === 'shape' && shapeId && state.layer.present.shapeIcons[shapeId] ? state.layer.present.shapeIcons[shapeId] : null);
  const iconData = getIconData({name, pathData, theme});
  return (
    <span
      className={`c-icon${
        size
        ? `${' '}c-icon--${size}`
        : ''
      }${
        variant
        ? `${' '}c-icon--${variant}`
        : ''
      }${
        outline
        ? `${' '}c-icon--outline`
        : ''
      }`}
      style={style}>
      <svg
        viewBox='0 0 24 24'
        width='24px'
        height='24px'>
        {
          name && name.startsWith('ease') && name !== 'ease-customWiggle-out'
          ? <polygon points={iconData.points} />
          : <>
              <path d={iconData && iconData.fill ? iconData.fill : path ? path : null} />
              {
                iconData && iconData.opacity
                ? <path
                    className='c-icon__opacity'
                    d={iconData.opacity} />
                : null
              }
            </>
        }
      </svg>
    </span>
  )
}

export default Icon;